(2, 1, 'Anzeige aller archivierten Aufgaben', 'Anzeige aller archivierten Aufgaben als Übersicht, damit Aufgaben gelöscht werden können.', 4.00, 28, 1, 2, '2008-07-06', '0000-00-00', '', 1, '2008-07-06 22:55:59'),
